import React from 'react';
import Firebase, { FirebaseContext } from '../firebase';
import SignIn from '../signIn';

class Home extends React.Component{
    render(){
        return (
            <div>
                <FirebaseContext.Consumer>
                    {
                        firebase => 
                            <SignIn firebase = {firebase}/>

                    }
                </FirebaseContext.Consumer>
            </div>

        );
    }
}

export default Home;
